import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { fadeIn } from '../styles/animations';
import PropTypes from 'prop-types';

const cardVariants = {
  hidden: { opacity: 0, y: 20 },
  visible: { 
    opacity: 1, 
    y: 0,
    transition: {
      duration: 0.5,
      ease: "easeOut"
    }
  },
  hover: {
    y: -4,
    transition: {
      duration: 0.2,
      ease: "easeInOut"
    }
  }
};

const FornecedorCard = ({ fornecedor }) => {
  return (
    <Card>
      <CardHeader>
        <LogoContainer>
          <Logo src={fornecedor.logo} alt={`${fornecedor.nome} logo`} />
        </LogoContainer>
        <Badge>{`Economia de ${fornecedor.economia}%`}</Badge>
      </CardHeader>

      <CardContent>
        <Title>{fornecedor.nome}</Title>
        <Description>{fornecedor.descricao}</Description>

        <InfoGrid>
          <InfoItem>
            <InfoLabel>Estado</InfoLabel>
            <InfoValue>{fornecedor.estadoOrigem}</InfoValue>
          </InfoItem>
          <InfoItem>
            <InfoLabel>Custo kWh</InfoLabel>
            <InfoValue>R$ {fornecedor.custoKwh.toFixed(2)}</InfoValue>
          </InfoItem>
          <InfoItem>
            <InfoLabel>Limite Mínimo</InfoLabel>
            <InfoValue>{fornecedor.limiteMinKwh.toLocaleString()} kWh</InfoValue>
          </InfoItem>
          <InfoItem>
            <InfoLabel>Total Clientes</InfoLabel>
            <InfoValue>{fornecedor.totalClientes.toLocaleString()}</InfoValue>
          </InfoItem>
        </InfoGrid>

        <RatingContainer>
          <Stars rating={fornecedor.avaliacaoMedia} />
          <RatingValue>{fornecedor.avaliacaoMedia.toFixed(1)}/5.0</RatingValue>
        </RatingContainer>

        <CertificacoesContainer>
          {fornecedor.certificacoes.map(cert => (
            <Certificacao key={cert}>{cert}</Certificacao>
          ))}
        </CertificacoesContainer>
      </CardContent>
    </Card>
  );
};

FornecedorCard.propTypes = {
  fornecedor: PropTypes.shape({
    logo: PropTypes.string.isRequired,
    nome: PropTypes.string.isRequired,
    descricao: PropTypes.string.isRequired,
    estadoOrigem: PropTypes.string.isRequired,
    custoKwh: PropTypes.number.isRequired,
    limiteMinKwh: PropTypes.number.isRequired,
    totalClientes: PropTypes.number.isRequired,
    avaliacaoMedia: PropTypes.number.isRequired,
    certificacoes: PropTypes.arrayOf(PropTypes.string).isRequired
  }).isRequired
};

const Card = styled.div`
  background: ${({ theme }) => theme.colors.background.card};
  border-radius: ${({ theme }) => theme.borderRadius.lg};
  box-shadow: ${({ theme }) => theme.shadows.md};
  overflow: hidden;
  transition: transform 0.2s ease;

  &:hover {
    transform: translateY(-4px);
  }
`;

const CardHeader = styled.div`
  background: ${({ theme }) => theme.colors.background.cardHeader};
  padding: ${({ theme }) => theme.spacing.lg};
  border-bottom: 1px solid ${({ theme }) => theme.colors.border};
  text-align: center;
  position: relative;
  height: 160px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  gap: ${({ theme }) => theme.spacing.md};
`;

const LogoContainer = styled.div`
  width: 120px;
  height: 120px;
  border-radius: 50%;
  overflow: hidden;
  border: 4px solid ${({ theme }) => theme.colors.background.card};
  box-shadow: ${({ theme }) => theme.shadows.md};
  margin: 0 auto;
  background: white;
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 1rem;
`;

const Logo = styled.img`
  width: 100%;
  height: 100%;
  object-fit: contain;
`;

const Badge = styled.div`
  position: absolute;
  top: 1rem;
  right: 1rem;
  background: ${({ theme }) => theme.colors.primary.main};
  color: ${({ theme }) => theme.colors.text.inverse};
  padding: 0.25rem 0.75rem;
  border-radius: ${({ theme }) => theme.borderRadius.sm};
  font-size: 0.75rem;
  font-weight: 600;
`;

const CardContent = styled.div`
  padding: ${({ theme }) => theme.spacing.lg};
`;

const Title = styled.h3`
  color: ${({ theme }) => theme.colors.text.primary};
  font-size: ${({ theme }) => theme.typography.h3.fontSize};
  text-align: center;
  margin: 0;
  font-weight: 600;
  line-height: 1.2;
  max-width: 90%;
`;

const Description = styled.p`
  color: ${({ theme }) => theme.colors.text.secondary};
  margin: 0;
  font-size: ${({ theme }) => theme.typography.body1.fontSize};
  text-align: center;
  line-height: 1.4;
  max-width: 90%;
  display: -webkit-box;
  -webkit-line-clamp: 2;
  -webkit-box-orient: vertical;
  overflow: hidden;
  text-overflow: ellipsis;
`;

const InfoGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  gap: ${({ theme }) => theme.spacing.md};
  margin-bottom: ${({ theme }) => theme.spacing.md};
`;

const InfoItem = styled.div``;

const InfoLabel = styled.div`
  font-size: ${({ theme }) => theme.typography.body2.fontSize};
  color: ${({ theme }) => theme.colors.text.light};
  margin-bottom: ${({ theme }) => theme.spacing.xs};
  font-weight: 500;
`;

const InfoValue = styled.div`
  font-size: ${({ theme }) => theme.typography.body1.fontSize};
  color: ${({ theme }) => theme.colors.text.primary};
  font-weight: 600;
`;

const RatingContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  margin-top: ${({ theme }) => theme.spacing.md};
  margin-bottom: ${({ theme }) => theme.spacing.md};
`;

const Stars = styled.div`
  margin-right: ${({ theme }) => theme.spacing.sm};
`;

const RatingValue = styled.div`
  font-weight: 600;
  color: ${({ theme }) => theme.colors.text.primary};
  font-size: ${({ theme }) => theme.typography.body1.fontSize};
`;

const CertificacoesContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  margin-top: ${({ theme }) => theme.spacing.md};
  margin-bottom: ${({ theme }) => theme.spacing.md};
`;

const Certificacao = styled.span`
  background: ${({ theme }) => theme.colors.primary.main}20;
  color: ${({ theme }) => theme.colors.primary.main};
  padding: ${({ theme }) => `${theme.spacing.xs} ${theme.spacing.sm}`};
  border-radius: ${({ theme }) => theme.borderRadius.sm};
  font-size: ${({ theme }) => theme.typography.body2.fontSize};
  font-weight: 600;
  border: 1px solid ${({ theme }) => theme.colors.primary.main}40;
  margin-right: ${({ theme }) => theme.spacing.sm};
`;

export default FornecedorCard;
